Information
------------------------------

Kanha National Park
In the middle of the Indian subcontinent in the state of Madya Pradesh there is a national park named Kanha which is not very well known. The park was created in 1955 by special legislation and since then it has dedicated itself to preserving a variety of animal species. Many endangered species have indeed been saved here. Today Kanha is among the few most scenic and beautiful wildlife reserves in Asia. This &quot;Tiger Country&quot; is the ideal home for both predator and prey. Kanha is a perfect place to observe wildlife and is one of the first nine Project Tiger areas initiated in 1973. Kanha National Park is worth visiting to experience the wildlife in its purest natural habitat and also to enjoy the hospitality of the people who make visitors feel completely at home.

